			<Nav/>
			<div className="main__body">
				<Routes>
					<Route path="/profile/*" element={<Profile/>}/>
					<Route path="/dialogs/*" element={<Dialogs/>}/>
					<Route path="/users/*" element={<Users/>}/>
				</Routes>
			</div>
		</main>
	)
}

export default Main;
